import styled from "styled-components";
import { IoMenu } from "react-icons/io5";


export const HeaderStyled = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

export const MenuIcon = styled(IoMenu)`
fill: #333D4B;
width: 16px;
height: 15px;
`
